    return (
        <Route
            {...rest}
            render={props => {
                if (VEHICLE_REGISTRATION == "" ) {
                 
                    console.log(VEHICLE_REGISTRATION)
                    localStorage.clear()
                    return <Component{...props} />
                    
                } else {
                    return <Redirect to ="/vehicleregistration" />
            }
            }}
        />
    )
}
